import React from "react";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";

const Header = props => {
	return (
		<div>
			<Grid container spacing={1}>
				<Grid item xs={6}>
					<Paper>
						<Typography align="center">Number Of Questions</Typography>
						<Typography align="center">{props.numberOfQuestions}</Typography>
					</Paper>
				</Grid>
				<Grid item xs={6}>
					<Paper>
						<Typography align="center">Estimated Time</Typography>
						<Typography align="center">{props.estimatedTime}</Typography>
					</Paper>
				</Grid>
			</Grid>
		</div>
	);
};

export default Header;
